          body: "# Release v0.119.0\n\n## \U0001F680 Features\n\n- Add resolve conflicts
            option on addon create (#5880)\n\n## \U0001F3AF Improvements\n\n- Improve
            error message when Fargate is unsupported in an AZ (#5875)\n\n## \U0001F41B
            Bug Fixes\n\n- Fix setting cluster DNS for managed Ubuntu (#5889)\n- Fix
            AWS auth when \\`AWS\\_PROFILE\\` is set (#5854)\n- Make AMI Bottlerocket
            value case insensitive (#5852)\n\n## \U0001F9F0 Maintenance\n\n- Fix publish-docs
            workflow (#5901)\n- Remove dependency on k8s.io/legacy-cloud-providers
            (#5899)\n- Upgrade vulnerable dependencies (#5890)\n\n## \U0001F4DD Documentation\n\n-
            Updates to additional volumes mapping section and docs theme (#5885)\n\n##
            Acknowledgments\nWeaveworks would like to sincerely thank:\n@faraazkhan\n\n"
