          body: "# Release v0.125.0\n\n## \U0001F680 Features\n\n- Add support for
            placement groups in Outposts (#6104)\n\n## \U0001F3AF Improvements\n\n-
            Make Kubernetes 1.24 default version in eksctl (#6094)\n- Remove support
            for heptio-authenticator-aws (#6096)\n- Bump sourcegraph/go-diff to a
            version which supports Apple diff timestamps (#6088)\n\n## \U0001F41B
            Bug Fixes\n\n- Fix config file support for `get addons` (#6100)\n- Allow
            Nvidia, Neuron and AWS node containers to run as root (#6065)\n\n## \U0001F9F0
            Maintenance\n\n- Fix identity provider integration test (#6115)\n- Updated
            dependencies and actions (#6117)\n\n"
