          body: "# Release v0.129.0\n\n## \U0001F680 Features\n\n- Add support for
            Spain (eu-south-2) region (#6234)\n- Add support for Hyderabad (ap-south-2)
            region (#6231)\n- Add support for Zurich (eu-central-2) region (#6230)\n-
            Allow all EKS versions to be used for Outposts clusters (#6227)\n\n##
            \U0001F9F0 Maintenance\n\n- Fix kube-proxy assertion in integration test
            (#6226)\n- Wait for coredns to be deleted before recreating in addons
            integration test (#6225)\n\n## \U0001F4DD Documentation\n\n- Update availabilityZones
            example under managed node group (#6223)\n- Add user docs for Bottlerocket
            custom AMI support (#6228)\n- Add note on how pod disruption budget policies
            influence cluster deletion (#6209)\n- Updated material theme, footer and
            landing page (#6204)\n\n## Acknowledgments\nWeaveworks would like to sincerely
            thank:\n@yuxiang-zhang and @vsoch\n\n"
