          body: "# Release v0.151.0\n\n## \U0001F680 Features\n\n- Support custom
            AMIs for self-managed Windows nodegroups (#6804)\n- Support custom Ubuntu
            AMIs for EKS-managed nodegroups (#6850)\n\n## \U0001F3AF Improvements\n\n-
            Remove support for EKS 1.22 (#6704)\n\n## \U0001F41B Bug Fixes\n\n- Fix
            error with tar in `Post Cache go-build and mod` step (#6840)\n- Fix setting
            link-time variables for release version (#6841)\n- Select one subnet for
            AZs where multiple are present and no VPC config provided (#6814)\n- Paginate
            instance type offerings response (#6832)\n\n\n## \U0001F9F0 Maintenance\n\n-
            Bump dependencies (#6852, #6859)\n- Cleanup Flux Integration (#6836)\n\n##
            Acknowledgments\nWeaveworks would like to sincerely thank:\n  @watany-dev\n\n"
